import React from 'react'

type Props = {
    title: string,
    content: string
}

export const Template = (props: Props) => {
  return (
    <div className=" w-[500px] h-[600px] font-serif  bg-white absolute inset-x-10 inset-y-[5%] rounded-sm py-5 px-8 flex flex-col text-[12px]">
          
          <img src="/assets/logoPoli.png" alt="psmza" className="w-[150px] mx-auto" />
          
          <div className="mt-5">
            <h1 className=" uppercase font-bold underline text-[12px]">{props.title}</h1>

            <section className="mt-10">
                <p className=" indent-8">{props.content}</p>
            </section>
          </div>

    </div>
  );
}
